          <div className="lsItem">
            <label>Check-in-Date</label>
            <span>{`${format(date[0].startDate, "dd/MM/yyyy")} to
            ${format(date[0].endDate, "dd/MM/yyy")}`}</span>
            </div>
          </div>
        <div className="listResult"></div>


      </div>
    </div>
  </div>
  )
}

export default List
